export class EXPERIMENTAL_GeometryApi {
    #iframeMessenger;
    constructor(iframeMessenger) {
        this.#iframeMessenger = iframeMessenger;
    }
    async EXPERIMENTAL_getVolume25DCollection({ path, urn, }) {
        return await this.#iframeMessenger.sendRequest("geometry/get-volume-25d-collection", {
            path,
            urn,
        });
    }
}
